import resumeData from '../../utils/resumeData';
import CustomButton from '../Button/Button';
import { HomeRounded, SchoolRounded, WorkRounded, Facebook, Twitter, LinkedIn, GitHub, Telegram, } from '@mui/icons-material/'
import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Button, Form, FormControl, Nav, Navbar, NavDropdown } from 'react-bootstrap';
import { Link, NavLink } from "react-router-dom";
import withRouter from '../../utils/withRouter.js'; //created function to use withRouter on react-router-dom v6
import './Header.css'

const Header = (props) => {
    const pathName = props?.location?.pathname;

    return (
        <Navbar expand="lg" sticky='top' className='header'>
            <Nav.Link as={NavLink} to='/'>
                <Navbar.Brand className='header_home'>
                    <HomeRounded />
                </Navbar.Brand>
            </Nav.Link> 

        <Navbar.Toggle />

        <Navbar.Collapse>
        <Nav>
        {/* resume */}
        <Nav.Link as={NavLink} to='/' className={pathName == '/' ? 'header_link_active' : 'header_link'}>
        <span className='resume_text'>
        Resume
        </span>
        </Nav.Link>
        {/* portfolio */}
        <Nav.Link as={NavLink} to='/portfolio' className={pathName == '/portfolio' ? 'header_link_active' : 'header_link'}>
        Portfolio
        </Nav.Link>
        </Nav>
        <div className='header_right'>
        {Object.keys(resumeData.socials).map(key => (
        <a href={resumeData.socials[key].link} target='_blank'>{resumeData.socials[key].icon}
        </a>
        ))}
        <CustomButton text={'Hire me'} icon=<Telegram /> />
        </div>
        </Navbar.Collapse>
        </Navbar>
    );
};

export default withRouter(Header);
